  true,\n\t\"url\": null,\n\t\"notes\": \"Security automation reference data is currently
  housed within the NVD. The NVD is the U.S. Government repository of security automation
  data based on security automation specifications. This data provides a standards-based
  foundation for the automation of software asset, vulnerability, and security configuration
  management; security measurement; and compliance activities. This data supports
  security automation efforts based on the Security Content Automation Protocols (SCAP).
  The NVD includes databases of security configuration checklists for the NCP, listings
  of publicly known software flaws, product names, and impact metrics. A formal validation
  program tests the ability of vendor products to use some forms of security automation
  data based on a product's conformance in support of specific enterprise capabilities.\",\n\t\"license_title\":
